import React from 'react';

const NewResident = () => {
	return (
		<div>
			<form>
  				<label>
    				Name:
    				<input type="text" name="name" />
  				</label>
  					<input type="submit" value="Submit" />
			</form>		
		</div>
	);
}

export default NewResident;
